import { Navigate } from "react-router-dom";
import FeatherIcon from "feather-icons-react";

export const Login = ({ loggedIn, checkFingerprint, isDoctor, name, message }) => {
    return (
        <div>
            {loggedIn ? (
                isDoctor ? (
                    <Navigate to="/doctor" />
                ) : (
                    <Navigate to="/patient" />
                )
            ) : (
                <div className="w-screen flex-col gap-4 h-screen flex items-center justify-center">
                    <button className='rounded-xl fixed flex flex-row items-center gap-2 text-lg tracking-wide text-sm px-5 py-3 w-max logInBtn' onClick={checkFingerprint}><FeatherIcon icon='log-in' size={15}/> Log In</button>
                    <div className="mt-20">{message}</div>
                </div>
            )}
        </div>
    );
};
